import { BsSearch } from 'react-icons/bs';

function Searchbar()
{
  return (
    <>

      <input class="" type="text" placeholder="Search" />
      <Button type="submit" class="btn btn-primary">HI</Button>


    </>
  );
}

export default Searchbar;
